import ReactDOM from 'react-dom/client';
import React from 'react';
import './index.css';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import App from './App';
import Header from './componentes/Header/header';
import NavBar from './componentes/NavBar/navbar'
import Inicio from './paginas/Inicio/inicio';
import Profesor from './paginas/Profesor/profesor';
import ProfesorProfesor1 from './paginas/Profesor/Profesor1/Profesor1';
import ProfesorProfesor1Reseña from './paginas/Profesor/Profesor1/Profesor1/reseña';

const router = createBrowserRouter([
  {
    path: "/",
    element: <Inicio/>,
  },
  {
    path: "profesor",
    element: <Profesor/>,
  },
  {
    path: "profesor/Profesor1",
    element: <ProfesorProfesor1/>,
  },
  {
    path: "profesor/Profesor1/Reseña",
    element: <ProfesorProfesor1Reseña/>,
  },
]);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>


);
